description:
A burlesque star seeks to keep her convent-raised daughter away from her low-down life and abusive lover/stage manager. The film is notable as one of the few films of its time to break free from the restrictions of bulky sound technology equipment in order to shoot on location around Manhattan.

Video: 632x480, 4136 kbps, 29 fps  
Audio: 128kbps, mono, 48khz

